import React, { useEffect } from 'react';


const Testing = () => {
    useEffect(() => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';

        return () => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';
        };
    }, []);

    return (
        <div className="content">
        <h1>Testing</h1>
        </div>
    );
    };

export default Testing;
